import React, {Component} from 'react';
import './App.css';

import Person from './Person/Person';

class App extends Component {
  state = {
    persons: [
      {
        name: "Sonia",
        age: 1
      },
      {
        name: "SoniaJ",
        age: 2
      },
      {
        name: "SoniaJa",
        age: 3
      },
    ]
  }

  render() {
  return (
    <div className="App">
     <h1>React Project</h1>
     <p>This is really working!</p>
     <Person name={this.persons[0].name} age="1" />
     <Person name="SoniaJ" age="2"><b>Hobbies::</b> ABCD </Person>
     <Person name="SoniaJa" age="3" />
    </div>
  );
  }
}

export default App;
